import React from "react";
import { Tile } from "../tile/Tile";

export const TileList = (tiles) => {

  return (
    <div>
      {tiles.tiles.map((tile, index) => {
        const { name, ...rest } = tile;

        return (
          <Tile
            key={index}
            name={name}
            description={rest} // Pass the rest of the properties as an object
          />
        );
      })}
    </div>
  );
};
